import React, { Component } from 'react';

class AddTodo extends Component {
  
  render() { 
    return ( 
      <div>
        <form>
          <input 
            type="text"
            name="title"
          />
          <input
            type= "submit"
            value = "Submit"
          />
        </form>
      </div>
     );
  }
}
 
export default AddTodo;
